// src/pages/CalendarPage.js
import {React} from 'react';
import { Box, TextField, Typography } from '@mui/material';
import BasicDatePicker from '../components/EntryForm/EntryDatePicker';
import MultilineTextFields from '../components/EntryForm/EntryMultilineTextField';
import BasicTextFields from '../components/EntryForm/EntryTextField';
import SelectVariants from '../components/EntryForm/EntrySelectField';
import {useForm} from 'react-hook-form';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { Button } from '@mui/material';
import Checkboxes from '../components/EntryForm/EntryCheckBox';



const Entry = () => {
  const {handleSubmit,reset,setValue,control} = useForm()
  const submission = (data) => console.log(data)
  return (

  <div>
    <form onSubmit={handleSubmit(submission)}>

    <Box sx={{display: 'flex', width: '100%', backgroundColor: '#00003f',  // Corrected background color
  marginBottom: '10px', padding: '2px',  // Optional: Adds padding to make the header stand out
  alignItems: 'center',  // Centers the text vertically
}}>
  <Typography sx={{
    marginLeft: '20px', 
    color: '#ffffff',  // Corrected color code for white
    fontWeight: 'bold',  // Optional: Makes the text bolder for emphasis
    fontSize: '1.5rem',  // Optional: Adjusts the font size
  }}>
    Start a New Journal Entry
  </Typography>
</Box>

    <Box sx={{display:'flex', width: '100%', boxShadow: 3, padding: 4 ,flexDirection: 'column'}}>

    <Box sx={{display:'flex', justifyContent:'space-evenly', flexDirection: 'column', }}>
        
        <BasicDatePicker
          label="Date"
          name="date"
          control ={control}
        />

        <MultilineTextFields
          label = "Name" 
          name="name"
          control={control}
          placeholder="Provide an entry name" 
        />

        <SelectVariants
          name = "age"
          control = {control}>
        </SelectVariants>

        <Checkboxes
          name= "proper_nutrition"
          control = {control}
            label= "Proper Nutrtion">
        </Checkboxes>

        <Checkboxes
          name= "proper_hydration"
          control = {control}
            label= "Proper Hydration">
        </Checkboxes>

        <Checkboxes
          name= "proper_exercise"
          control = {control}
            label= "Proper Exercise">
        </Checkboxes>
        
        <BasicTextFields
        name= "exercise_duration"
          control = {control}
            label= "Exercise duration">
        </BasicTextFields>

        <BasicTextFields
        name= "exercise_description"
          control = {control}
            label= "Exercise description">
        </BasicTextFields>

        <BasicTextFields
        name= "hours_of_sleep"
          control = {control}
            label= "Hours of sleep">
        </BasicTextFields>
        


      </Box>
      <Box> 
        
        <Button variant="contained" type="submit" sx = {{width:'100%'}}>
          Submit
        </Button>
      </Box>


    </Box>
    </form>

  </div>
  )
  };
export default Entry;
